const theUrl = "http://localhost:5000";

const getAdminList = theUrl+'/getAdminList';

const tokenHeaders = (token) => {
    return {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
        'Authorization': "Bearer " + token
    }
} 

export {
    theUrl,
    getAdminList,
    tokenHeaders
}